void SendGCodeCommand(GCodeTypeDef *X)
{
	xQueueSend(GCodeQueue, (void *) X, portMAX_DELAY);
}

void ZeroGCommand(GCodeTypeDef* X)
{
	X->A = 0;
	X->I = 0;
	X->J = 0;
	X->K = 0;
	X->R = 0;
	X->X = 0;
	X->Y = 0;
	X->Z = 0;
	X->code = 0;
	X->feedRate = 0; //todo: Make 100% feed rate ????

	X->dontStop = 0;
}

void SendHomePos()
{
	GCodeTypeDef XX;
	ZeroGCommand(&XX);
	SendGCodeCommand(&XX);
}

void SendLinearMoveXY(uint32_t X, uint32_t Y)
{
	GCodeTypeDef XX;
	ZeroGCommand(&XX);
	XX.code = 1;
	XX.X = X;
	XX.Y = Y;

	SendGCodeCommand(&XX);
}

void draw_decart_space(uint16_t x_mm, uint16_t y_mm)
{
#define step_mm 10
	for(uint16_t i=step_mm; i<=x_mm; i+=step_mm*2)
	{
		SendLinearMoveXY(i*X_1MM, 0*Y_1MM);
		SendLinearMoveXY(i*X_1MM, y_mm*Y_1MM);
		SendLinearMoveXY((i+step_mm)*X_1MM, y_mm*Y_1MM);
		SendLinearMoveXY((i+step_mm)*X_1MM, 0*Y_1MM);
	}
	SendHomePos();
	for(uint16_t i=step_mm; i<=y_mm; i+=step_mm*2)
	{
		SendLinearMoveXY(0*X_1MM, i*Y_1MM);
		SendLinearMoveXY(x_mm*X_1MM, i*Y_1MM);
		SendLinearMoveXY(x_mm*X_1MM, (i+step_mm)*Y_1MM);
		SendLinearMoveXY(0*X_1MM, (i+step_mm)*Y_1MM);
	}
	SendHomePos();
}
void SendRadialMoveXY(int32_t X, int32_t Y, int32_t radius, uint16_t code, uint8_t dontstop)
{
	GCodeTypeDef XX;
	ZeroGCommand(&XX);
	XX.code = code;
	XX.X = X;
	XX.Y = Y;
	XX.R = radius;//30*X_1MM;//abs(X)>abs(Y)?2*abs(X):2*abs(Y);
	XX.dontStop = dontstop;

	SendGCodeCommand(&XX);
}

void SendRadialMoveXYADV(uint32_t X, uint32_t Y, uint32_t I, uint32_t J, uint16_t code, uint8_t dontstop)
{
	GCodeTypeDef XX;
	ZeroGCommand(&XX);
	XX.code = code;
	XX.X = X;
	XX.Y = Y;
	XX.I = I;
	XX.J = J;
	XX.R = 0;//30*X_1MM;//abs(X)>abs(Y)?2*abs(X):2*abs(Y);
	XX.dontStop = dontstop;

	SendGCodeCommand(&XX);
}




