void TestCircle(int32_t radius)
{
	static uint8_t dir = 0;
	int32_t mass[8];
	if(dir == 0)
	{
		mass[0] = CNCCoordinates.step[0] + radius * X_1MM;
		mass[1] = CNCCoordinates.step[1] + radius * Y_1MM;
		mass[2] = CNCCoordinates.step[0];
		mass[3] = CNCCoordinates.step[1] + radius * 2 * Y_1MM;
		mass[4] = CNCCoordinates.step[0] - radius * X_1MM;
		mass[5] = CNCCoordinates.step[1] + radius * Y_1MM;
		mass[6] = CNCCoordinates.step[0];
		mass[7] = CNCCoordinates.step[1];
	}
	else
	{
		mass[0] = CNCCoordinates.step[0] - radius * X_1MM;
		mass[1] = CNCCoordinates.step[1] + radius * Y_1MM;
		mass[2] = CNCCoordinates.step[0];
		mass[3] = CNCCoordinates.step[1] + radius * 2 * Y_1MM;
		mass[4] = CNCCoordinates.step[0] + radius * X_1MM;
		mass[5] = CNCCoordinates.step[1] + radius * Y_1MM;
		mass[6] = CNCCoordinates.step[0];
		mass[7] = CNCCoordinates.step[1];
	}
	if(dir == 0)
	{
		SendRadialMoveXY(	mass[0],
							mass[1],
							radius * X_1MM, 3, 1);
		SendRadialMoveXY(	mass[2],
							mass[3],
							radius * X_1MM, 2, 1);
		SendRadialMoveXY(	mass[4],
							mass[5],
							radius * X_1MM, 3, 1);
		SendRadialMoveXY(	mass[6],
							mass[7],
							radius * X_1MM, 2, 0);
		dir = 1;
	}
	else {
		SendRadialMoveXY(	mass[0],
							mass[1],
							radius * X_1MM, 3, 1);
		SendRadialMoveXY(	mass[2],
							mass[3],
							radius * X_1MM, 2, 1);
		SendRadialMoveXY(	mass[4],
							mass[5],
							radius * X_1MM, 3, 1);
		SendRadialMoveXY(	mass[6],
							mass[7],
							radius * X_1MM, 2, 0);
		dir = 0;
	}
}


