uint16_t ParseNum(uint8_t *mass)
{
	return atoi((const char*)mass);
}

float stof(uint8_t* s)
{
	float rez = 0, fact = 1;
	if(*s == '-')
	{
		s++;
		fact = -1;
	}
	for(int point_seen = 0; *s; s++)
	{
		if(*s == '.' || *s == ',')
		{
			point_seen = 1;
			continue;
		}
		int d = *s - '0';
		if(d >= 0 && d <= 9)
		{
			if(point_seen)
				fact /= 10.0f;
			rez = rez * 10.0f + (float) d;
		}
	}
	return rez * fact;
}


uint64_t ParseFloat(uint8_t *mass)
{
	float x = stof/*atoff*/(mass);
	return (uint64_t)(x*X_1MM);
}

