void Parser(uint8_t i)
{
	uint32_t ptr = 0, size = sizeof(WorkMassive);

	uint8_t parseNum[15];
	uint8_t param = 0;
	uint64_t num = 0;

	GCodeTypeDef GParsed;
	ZeroGCommand(&GParsed);


	for(; ptr<size; )
	{
		//ZeroGCommand(&GParsed); //don't need!!!!
		//Find GCode start
		while(WorkMassive[ptr] != 'G')
		{
			ptr++;
			if(ptr > size)
				return;
		}
		ptr++;
		//Parse num of GCode
		uint8_t max = 0;
		while(WorkMassive[ptr] != ' ')
		{
			if(max < 15)
			{
				parseNum[max++] = WorkMassive[ptr];
				parseNum[max] = '\0';
			}
			ptr++;
			if(ptr > size)
				return;
		}
		GParsed.code = ParseNum(parseNum);
//		if(GParsed.code == 0)
//			GParsed.code = 1;
againParam:
		ptr++;
		if(ptr > size)
			return;

		while(WorkMassive[ptr] < 'A' && WorkMassive[ptr] > 'z')
		{
			ptr++;
			if(ptr > size)
				return;
		}

		//find parameter
		if(WorkMassive[ptr] == 'X' || WorkMassive[ptr] == 'x')
			param = 1;
		else if(WorkMassive[ptr] == 'Y' || WorkMassive[ptr] == 'y')
			param = 2;
		else if(WorkMassive[ptr] == 'Z' || WorkMassive[ptr] == 'z')
			param = 3;
		else if(WorkMassive[ptr] == 'I' || WorkMassive[ptr] == 'i')
			param = 4;
		else if(WorkMassive[ptr] == 'J' || WorkMassive[ptr] == 'j')
			param = 5;
		else if(WorkMassive[ptr] == 'K' || WorkMassive[ptr] == 'k')
			param = 6;
		else if(WorkMassive[ptr] == 'G')
		{
			GParsed.code = 1;
			while((uxQueueMessagesWaiting(GCodeQueue) > 5))
			{
				vTaskDelay(10);
			}
			fuckBuffer[18]++;
			SendGCodeCommand(&GParsed);
			continue;
		}
		else
			param = 0;

		ptr++;
		if(ptr > size)
			break;
		//get parameter number
		max = 0;
		while(WorkMassive[ptr] != ' ')
		{
			if(max < 15)
			{
				parseNum[max++] = WorkMassive[ptr];
				parseNum[max] = '\0';
			}

			ptr++;
			if(ptr > size)
				break;
		}

		num = ParseFloat(parseNum);
		if(param == 1 || param == 2)
		{
			if(param == 1)
			{
				GParsed.code = 1;
				GParsed.X = num;
			}
			if(param == 2)
			{
				GParsed.code = 1;
				GParsed.Y = num;
			}
			if(param == 3)
				continue;
		}

		goto againParam;
	}

}


