extern xSemaphoreHandle xLEDMutex;
extern  uint8_t SmallFont[];

void PrintCodes()
{
	ILI9327_setColor(VGA_RED);
	ILI9327_setBackColor(VGA_LIME);
	ILI9327_setFont(SmallFont);

	GCodeTypeDef GCommand;

	static uint16_t ppp=0;

	while(xQueueReceive(GCodeQueue, &GCommand, (TickType_t) 10))
	{
		//vTaskDelay(1000);
		xSemaphoreTake(xLEDMutex, portMAX_DELAY);
		{
			ILI9327_NumWDesc(0, 0 + ppp * 10, "X:", GCommand.X);
			ILI9327_NumWDesc(60, 0 + ppp * 10, "Y:", GCommand.Y);
			ILI9327_NumWDesc(120, 0 + ppp * 10, "Z:", GCommand.Z);
			ILI9327_NumWDesc(180, 0 + ppp * 10, "c:", GCommand.code);
			ppp++;
		}
		xSemaphoreGive(xLEDMutex);
	}

	vTaskEndScheduler();
}

